INSERT INTO `Categories` VALUES (1,'Feliz Páscoa','Nesta data quero compartilhar a alegria que renasce a cada momento do nosso conviver. Feliz Páscoa.'),(2,'Sempre Presente','Nesta data quero te presentear com um pedaço de mim, que é seu por você existir. Por toda vida ou por um momento que for.'),(3,'Crer Para Ver','Uma sociedade mais justa se constrói por meio de uma educação de qualidade. Foi com essa crença que a Natura criou, há 15 anos, o Crer Para Ver, um programa que investe diretamente na educação pública brasileira. Beneficiando milhões de pessoas para ajudar a transformar o nosso país.'),(4,'Natura Aquarela','Natura Aquarela é a maquiagem da mulher que vive sua brasilidade com arte. Mulher que valoriza suas tradições e reinventa suas histórias com ar moderno e contemporâneo. São produtos que realçam a pele e os lábios e destacam o olhar, com texturas leves e confortáveis, com várias opções de cores para traduzir alegria e feminilidade.'),(5,'Natura Chronos','Natura Chronos traz uma linha de produtos específicos para que cada mulher possa eleger o tratamento que melhor atenda às necessidades da sua pele, levando em conta características\r\ne relação com o tempo. Cada produto apresenta a melhor combinação de ativos e tecnologias que oferecem soluções completas de tratamento para o rosto e o corpo'),(6,'Natura Ekos','Unindo o conhecimento tradicional à tecnologia verde, Natura Ekos busca preservar o patrimônio ambiental e cultural brasileiro. Obtidos de forma sustentável, os ativos\r\nda linha oferecem benefícios comprovados cientificamente para o corpo e para os cabelos. Surpreenda-se com as cores, fragrâncias e texturas que são verdadeiros convites aos nossos sentidos.'),(7,'Natura Erva Doce','Fórmulas suaves para você vivenciar uma agradável sensação de bem-estar e conforto no dia a dia. Textura agradável e pH natural para cuidar da pele e o cheirinho inconfundível\r\nde Natura Erva Doce. Para despertar os sentidos e revitalizar suas energias.'),(8,'Natura Faces','Uma linha completa, com cosméticos e fragrâncias, feita para o ritmo da jovem mulher moderna. Fáceis de usar, os produtos são combináveis entre si. Natura Faces abre um mundo de possibilidades para você se expressar, se experimentar e conhecer a si mesma, seus limites e horizontes. Faça do seu jeito, ouse, tente de tudo.'),(9,'Natura Fotoequilíbrio','Uma linha completa que oferece proteção contra os raios UVA e UVB e combate os radicais livres e o fotoenvelhecimento. Seus produtos, sem fragrância, trazem fórmulas de textura leve, não oleosa e de rápida absorção, além de garantirem proteção imediata. Eles hidratam e protegem a pele para tornar a exposição ao sol um momento prazeroso e divertido.'),(10,'Natura Mamãe e Bebê','O bebê acolhido pelo olhar, pela voz, pelo cheiro da mãe, tocado e massageado, desenvolve-se seguro, saudável e mais feliz. Nos momentos de cuidado, ao tocar e massagear o bebê, a mãe fortalece o vínculo que tem com ele e o vínculo que ele tem com a vida.'),(11,'Natura Naturé','Natura Naturé é uma linha com embalagens, cores, cheiros, texturas e nomes curiosos, que estimulam a descoberta e ensinam seu filho a cuidar da água enquanto se diverte. Tibum no mundo para brincar, porque brincando se aprende a cuidar.'),(12,'Natura Plant','Natura Plant traz tratamentos sob medida para as necessidades específicas de cada tipo de cabelo. Suas fórmulas combinam tecnologia e ativos naturais de alta performance, com resultados visíveis desde a primeira aplicação.'),(13,'Natura Tododia','Os pequenos cuidados diários são uma experiência de bem-estar. Cada momento é único. Cada sensação é especial. Natura Tododia é uma linha de cuidados para o corpo que convive com você diariamente. Redescubra os pequenos prazeres em cada momento do seu dia, todos os dias. Mais carinho para você e proteção ao seu corpo.'),(14,'Perfumaria Natura','Perfumes provocam sensações e despertam sentimentos. São a arte de produzir estímulos que nos levam ao que realmente somos e nos reconectam com a nossa essência. A Natura cria marcas com conceitos que causam identificação e nos ajudam a expressar emoções profundas.'),(15,'Natura Sève','Uma linha de produtos de alta qualidade, com óleos 100% vegetais que proporcionam hidratação, toque aveludado e perfumação à pele. A riqueza de suas texturas e as fragrâncias exclusivas auxiliam o prazer do toque, a intimidade e o cuidado com o corpo, no despertar da feminilidade que leva ao fortalecimento da autoestima e faz aflorar beleza e sensualidade.'),(16,'Natura Una','Uma linha de maquiagem que desperta o prazer e os sentidos, unindo performance, tecnologia e ingredientes naturais, de um jeito único. Texturas diferenciadas e sensorial prazeroso, com cores de personalidade em uma paleta exclusiva e fórmulas que, além de retratarem a beleza, ajudam a cuidar da pele. Uma linha atenta a cada detalhe. Tudo para deixar a maquiagem surpreendente e o rosto radiante e luminoso.'),(17,'Natura Kaiak','Ao movimentar o corpo, o homem manifesta as emoções e acorda os sentidos.'),(18,'Sr N','Todo grande homem tem um grande homem como espelho. E aprendeu com ele a ver o sentido que pode haver nas pequenas coisas. Quando faz a barba, você esta cultivando um ritual de muitos significados. Um símbolo de renovação que representa a transformação do menino em homem. Natura Sr N é uma linha para quem se inspira nas coisas que perduram para criar o inesquecível.'),(19,'Natura Homem','Uma linha completa de cuidados pessoais para o homem, sem deixar de lado a simplicidade e a praticidade. '),(20,'Amó','Uma linha inspirada no amor que cultivamos todos os dias com gestos que encantam e seduzem. Suas fragrâncias e texturas estimulam o toque e a intimidade, colocando o amor em movimento.'),(21,'Natura Higeia','Uma linha de cuidado íntimo desenvolvida com ingredientes suaves para a delicada pele da região genital externa. Com fórmula com pH fisiológico, hidrata e deixa uma agradável fragrância.'),(22,'Natura VôVó','Na relação entre avós e netos, vive uma alegria que envolve, acolhe e inspira. Natura Vôvó nasceu para reverenciar e celebrar essa relação. Inspirados em raízes e frutos, que representam origem e continuidade, seus produtos falam de inspiração, cuidado e contato. Inspirada na vida para inspirar sua vida.');
