iveira dos brejinhos,Macaubas,Brotas de Macaubas,e Guanambi, Roda velha, Rosario ,Posse no Estado do Goiás, e a parti de Abril, estaremos fazendo as rota uma vez por semana para os municípios da Região Sudoeste da Bahia: Anagé,Vitoria da Conquista,Brumado, Barra do Choça, Belo Campo, Boa Nova, Bom Jesus da Serra, Caatiba, Caetanos, Caraíbas, Cravolândia, Firmino Alves, Ibicuí, Iguaí, Irajuba,Itambé, Itapetinga,Itaquara, Itarantim,Itiruçu, Itororó, Jaguaquara, Jequié,Lagedo do Tabocal, Macarani, Maiquinique,Manoel Vitorino, Maracás, Mirante, Planaltino, Planalto, Poções, Potiraguá, Ribeirão do Largo, Santa Inês, Tremedal e Vitória da Conquista. Com destaque para a cidade de Vitória da Conquista,Feira de santana,Salvador e Região Metropolitana,\n\nNo estado do tocantins atendemos com carga fechada ou frete fechado algunhas cidades, saindo de Luis Eduardo Magalhães-Bahia\n\nTaguatinga\nDianopolis\nAlmas\nNatividade\nCampos belo\nPorto nacional\nPalmas\nGurupi\nArraias\nNovo jardim\nBom jesus do tocantins\n\nQuero lembrar aos nossos parceiros que fechado nossa parceria, as mercadoria sendo entregue no galpão da Rapidex 10 transportes em Barreiras , após descarregado o caminhão ou carreta e conferido todas as mercadorias e notas , as encomendas estarão nas mãos o clientes das cidades indicadas na região do oeste-baiano no maxímo 24 e 48 horas apos , na região sudoeste da Bahia, nas cidades de Riacho de santana,Igaporan, serra do ramalho, Guanambi, Bom jesus da lapa,Caetité, Cacule,Brumado e ate 48 ou 72 horas, nas demais cidades da região sudoeste da Bahia a depender da quantidade e do peso da cargas temos um caminhão uma vez por semana atendendo as cidades nas demais rotas, \n\nObs: no galpão de Barreiras posso receber ate 3 carretas de vez , no espaço do Lem cabe uma carreta e um truck de vez, desde já agradeço e aguardo retorno para juntos formalizar essa nova parceria na região oeste e sudoeste Baiano e no estado do Tocantins.\n\nFILIAL\n\nRAPIDEX 10 PAPALOG LOGÍSTIC