INSERT INTO `Feeds` VALUES (1,'382381445421_393380117436254','No Programa Aqui tem Natura de hoje, a repórter Paloma Lopes vai até o ateliê do artista plástico Sérgio Lucena para uma experiência inusitada. O artista testará diferentes fragrâncias Natura e, inspirado em cada uma, interpretará com uma pintura.\n\nÉ daqui a pouco, a partir das 10h, nos intervalos do Programa Hoje em Dia, na Record.','Health/beauty',459,148,9),(2,'382381445421_507301265973586','No Programa Aqui tem Natura inédito de amanhã, Lorena Calábria entrevista uma família que multiplica relações e distribui afetos. Eles conversam sobre os novos modelos de família de hoje em dia e os laços de carinho e afeto que são criados entre familiares.\n\nÉ amanhã, a partir das 10h, nos intervalos do Programa Hoje Em Dia, na Record. Não perca.','Health/beauty',663,295,37),(3,'382381445421_10152722293085422','A produtora editorial Ana Reis, 33, tem energia de sobra para trabalhar, ver os amigos e cuidar de si mesma. Ela sabe ser prática e carrega tudo o que precisa para o dia a dia na sua bolsa. Você também pode. Quer ver? Acesse e confira: http://bit.ly/NaturaEuGosto','Health/beauty',4439,2465,161),(4,'382381445421_10152719908455422','Você sabia que apenas 30% das mulheres cuidam do rosto da maneira correta, usando um sabonete específico? Existe uma maneira correta de lavar o rosto? A limpeza é a primeira etapa para se ter uma pele bonita e bem cuidada. Aprenda quais são os produtos adequados para a limpeza do seu tipo de pele em http://scf.natura.net/chronos.','Health/beauty',4428,3572,205),(5,'382381445421_10152719144575422','Repartição de Benefícios: biodiversidade e conhecimento têm valor. Saiba mais: http://bit.ly/TKLJ9k','Health/beauty',3296,1044,100),(6,'382381445421_372671039512896','A Natura acredita que celebrar a relação é fortalecer os vínculos, renovar os laços e ressignificar o amor, lembrando o quanto é bom repartir a vida com o outro. Todos os dias temos motivos para estar presentes nas nossas relações. Assista ao vídeo da campanha e compartilhe com as pessoas especiais para você. \nhttp://youtu.be/pH5TugUigG8','Health/beauty',2995,1245,145),(7,'382381445421_10152710657295422','Você sabia que para ter uma pele bonita e saudável, são necessários apenas três passos? Limpar o rosto das impurezas, Tonificar para manter o equilíbrio da pele e Hidratar para finalizar os cuidados. Sem se esquecer, é claro, de usar sempre os produtos adequados para o seu tipo de pele. Descubra mais em http://scf.natura.net/chronos.','Health/beauty',4503,4902,261),(8,'382381445421_10152708973990422','Em uma rede em que todo mundo ganha, Natura Ekos apoia o desenvolvimento social, o fortalecimento da economia e a sustentabilidade ambiental de todas as comunidades fornecedoras. http://bit.ly/128kl7d','Health/beauty',1694,701,54),(9,'382381445421_10152708678090422','Nessa data quero compartilhar a alegria que renasce a cada momento do nosso conviver. Feliz Páscoa.','Health/beauty',2346,1426,88),(10,'382381445421_543200625719640','Acessando http://www.natura.net/tv você conhece o trabalho de uma associação ambiental que realiza iniciativas para proteger as florestas da região de Birigui, em São Paulo, e que conta com a colaboração da CNO Marli Massom, integrante do Programa Acolher.\n\nAté o próximo programa!','Health/beauty',443,167,24),(11,'382381445421_574150969263485','Natura Plant faz uma homenagem à força de vendas da Natura. Confira o vídeo especialmente gravado com as Gerentes de Relacionamento cantando a música “Cabelo Meu”.','Health/beauty',763,357,53),(12,'382381445421_10152706357825422','A Espuma de Limpeza Facial de Natura Chronos, é um sabonete para peles mistas a oleosas, com fórmula suave que limpa sem agredir a pele. O Creme Microesfoliante Purificante proporciona esfoliação intensa.\r\n\r\nNesse ciclo os dois produtos estão com preços especiais, procure a consultora mais próxima em http://bit.ly/1006U7Q e saiba como adquirir os seus.','Health/beauty',4488,4102,283),(13,'382381445421_10152705905905422','Ekos Sabonetes em Barra Puro Vegetal Sortidos Refrescantes deixam a pele suavemente perfumada. http://bit.ly/UXGfr7','Health/beauty',12748,6705,943),(14,'382381445421_221283494679012','No Programa Aqui tem Natura de hoje, Paloma Lopes é convidada da chef Bel Coelho para degustar um jantar muito especial, co-criado com a perfumista Verônica Kato.\n\nEm instantes, nos intervalos do programa Hoje Em Dia, na Record.','Health/beauty',591,199,35),(15,'382381445421_10152702859795422','O banho é um momento relaxante que pode proporcionar grandes sensações. A água tocando a pele possui um significado especial, que nos renova por dentro e por fora. Veja mais sobre a seleção especial de produtos para um banho que renova em http://bit.ly/NaturaEuGosto.','Health/beauty',11953,7928,655),(16,'382381445421_10152700055565422','Natura Chronos convida você para uma experiência reveladora, onde você aprende que cuidar de si mesma é o primeiro passo para sentir-se bela. Saiba mais sobre o Movimento Limpeza em http://scf.natura.net/chronos.','Health/beauty',3372,2570,162),(17,'382381445421_229506773854178','Hoje é o dia Mundial da Água. \n\nA data serve como meio para chamar a atenção sobre a importância da água doce e defender a gestão sustentável dos recursos hídricos. \n\nSaiba mais no Blog Ekos.','Health/beauty',1479,697,91),(18,'382381445421_303297959803083','Encontre um jeito único de misturar Natura do seu jeito. Para agradar perfis e momentos variados, fizemos uma seleção especial de produtos que se complementam. Conheça mais: http://bit.ly/NaturaEuGosto','Health/beauty',1324,731,92),(19,'382381445421_168917203261083','Acesse http://www.natura.net/tv e descubra a iniciativa de Consultores Natura de Espírito Santo que, por meio de reciclagem, ajudaram a reduzir o impacto ambiental e gerar novos empregos.\n\nAté o próximo Programa!','Health/beauty',464,173,52),(20,'382381445421_10152687162855422','Não perca Nilcéia, a nova Consultora Natura, no episódio da novela Salve Jorge de hoje. http://is.gd/NlOkO8','Health/beauty',985,166,82),(21,'382381445421_10152686739685422','Você sabia que na Amazônia a vegetação predominante é composta por árvores de médio e grande porte que mantêm suas folhas o ano inteiro? http://bit.ly/ZraTsC','Health/beauty',3510,1328,153),(22,'382381445421_620137981333344','No Programa Aqui tem Natura de hoje, a repórter Paloma Lopes mostra como o Humor pode deixar a vida muito mais leve.\n\nNão perca! É a partir das 10h, nos intervalos do Programa Hoje em Dia, na Record.','Health/beauty',591,213,57),(23,'382381445421_503777849684570','No Programa Aqui tem Natura de amanhã, Lorena Calábria entrevista a jornalista Ana Paula Padrão. Elas conversam sobre beleza e as expectativas de uma mulher contemporânea.\n\nÉ amanhã, a partir das 10h, nos intervalos do programa Hoje Em Dia, na Record.','Health/beauty',949,406,61),(24,'382381445421_10152684287760422','Você conhece alguém que tem esporte em sua rotina? Compartilhe as opções de sensações refrescantes, fragrâncias vibrantes e aromas únicos do perfil \"Homem e esporte\". Conheça mais em http://pinterest.com/natura/eu-gosto/','Health/beauty',6000,6816,338),(25,'382381445421_10152681681680422','Já pensou em dar um presente diferente nessa Páscoa?  Natura Mamãe e Bebê vem com uma Água de Colônia e uma toalha capuz.','Health/beauty',76562,17706,9549);
