INSERT INTO `Products` VALUES (1,'Presente Natura Mamãe e Bebê - sem álcool','Água de colônia:Fragrância com notas cítricas e florais, com fundo sândalo vanila musc. Possui embalagem inquebrável especialmente desenvolvida para proporcionar maior segurança à mãe e ao bebê. Dermatologicamente testado. Ph fisiológico.Toalha:Toalha de banho infantil com capuz na cor branca e viés na cor verde, tecido 100% algodão e logo de Mamãe e Bebê bordado no capuz.','Indicado para bebês. Para bebês menores de 30 dias, consulte sempre o pediatra.','Água de colônia:Perfumação Toalha:Secar o corpo do bebê após o banho.','1 Água de colônia 100ml, 1 Toalha e 1 Embalagem de presente.','Água de colônia:Coloque algumas gotas do produto na ponta dos dedos e aplique atrás dos lóbulos das orelhas em pequenas quantidades. Não aplique nas mucosas. Se desejar, aplique também nas roupinhas e no berço.Toalha:Pegue a toalha e seque o bebê cuidadosamente.','Água de colônia:AQUA, PEG-40 HYDROGENATED CASTOR OIL, PARFUM, POTASSIUM PHOSPHATE, DMDM HYDANTOIN, DISODIUM EDTA, POTASSIUM SORBATE, DISODIUM PHOSPHATE, BHT, BENZYL BENZOATE, CINNAMYL ALCOHOL, CITRAL, CITRONELLOL, COUMARIN, GERANIOL, HYDROXYCITRONELLAL, LIMONENE, LINALOOL, BUTYLPHENYL METHYLPROPIONAL, ALPHA-ISOMETHYL IONONE.Toalha:TECIDO 100% ALGODÃO.','R$ 49,80','http://scf.natura.net/Media/thumb/40005.jpg',1),(2,'Presente Natura Mamãe e Bebê - sem álcool flor de laranjeira','Água de colônia:Fragrância suave e delicada que combina notas florais da flor de laranjeira e cítricas com musc transmitindo agradável sensação de conforto. Possui embalagem inquebrável especialmente desenvolvida para proporcionar maior segurança à mãe e ao bebê. Dermatologicamente testado. Ph fisiológico Toalha: Toalha de banho infantil com capuz na cor branca e viés na cor verde, tecido 100% algodão e logo de Mamãe e Bebê bordado no capuz.','Indicado para bebês. Para bebês menores de 30 dias, consulte sempre o pediatra.','Água de colônia:Perfumação Toalha:Secar o corpo do bebê após o banho.','1 Água de Colônia Flor de laranjeira 100ml, 1 Toalha e 1 Embalagem de presente.','Água de colônia:Coloque algumas gotas do produto na ponta dos dedos e aplique atrás dos lóbulos das orelhas em pequenas quantidades. Não aplique nas mucosas. Se desejar, aplique também nas roupinhas e no berço.Toalha:Pegue a toalha e seque o bebê cuidadosamente.','Água de colônia:AQUA, PEG-40 HYDROGENATED CASTOR OIL, PARFUM, POTASSIUM PHOSPHATE, DMDM HYDANTOIN, DISODIUM EDTA, POTASSIUM SORBATE, DISODIUM PHOSPHATE, BHT.Toalha:TECIDO 100% ALGODÃO.','R$ 49,80','http://scf.natura.net/Media/thumb/40007.jpg',1),(3,'Presente Natura Faces Secreta','A linha Natura Faces traz a versão miniatura (20ml) do desodorante colônia Secreta. Um mundo de aromas e possibilidades para as suas consumidoras.Inspirada nas infinitas possibilidades da juventude, a linha Natura Faces traz novos glosses com uma maior cobertura e gostinhos de brigadeiro.','Para todos os tipos de pele.','Perfumar a pele. Colorir e dar brilho aos lábios.','1 Desodorante Colônia 20ml, 2 Glosses 8ml cada e 1 Embalagem de presente.','Desodorante Colônia:Para uma melhor perfumação, aplique nos punhos, pescoço, colo e atrás das orelhas.Gloss:Aplique o gloss no lábio superior, do meio para as extremidades, e no inferior de uma extremidade a outra.','Desodorante Colônia:INGREDIENTES: ALCOHOL, PARFUM, AQUA, POLYGLYCERYL-3 CAPRYLATE, BHT, DENATONIUM BENZOATE, AMYL CINNAMAL, BENZYL ALCOHOL, BUTYLPHENYL METHYLPROPIONAL, CITRAL, CITRONELLOL, COUMARIN, GERANIOL, HEXYL CINNAMAL,LIMONENE, LINALOOL.Gloss:INGREDIENTES: POLYBUTENE, RICINUS COMMUNIS SEED OIL, BIS-DIGLYCERYL POLYACYLADIPATE-2,  PRUNUS AMYGDALUS DULCIS OIL, SORBITAN OLIVATE, BIS-DIGLYCERYL POLYACYLADIPATE-1, PROPYLENE GLYCOL DICAPRYLATE/DICAPRATE, STEARALKONIUM HECTORITE, PROPYLENE CARBON','R$ 31,90','http://scf.natura.net/Media/thumb/40006.jpg',1),(4,'Presente Natura Naturé Meninos','Natura Naturé traz para a Páscoa um presente especial para meninos, que traz a col