 Seda, 1 Fita e 1 Cartão.','','','R$ 3,45','http://scf.natura.net/Media/thumb/32055.jpg',2),(11,'Sacola-Carrinho de Compras','As sacolas de compras são reutilizáveis, com adaptação de formato para utilização complementar com carrinho de supermercado. ','Homens e Mulheres','Otimização do tempo na finalização de compras no supermercado (dispensa várias sacolas que tem que ser sendo transportadas do caixa para o carrinho de supermercado para o carro) e redução no consumo de sacolas plásticas descartáveis','','Unir as sacolas pelo velcro, colocar dentro do carrinho com a face frontal da sacola menor virada para a frente do carrinho de supermercado e utilizar as alças para amarrar a sacola ao carrinho. Ao finalizar as compras, desamarrar as alças, separar as sacolas e retirar do carrinho de supermercado','','R$ 51,10','http://scf.natura.net/Media/thumb/27764.jpg',3),(12,'Livro Lá Vem História','Com 30 histórias do folclore mundial, a obra, de Heloisa Prieto, desperta o gosto pela leitura e é um dos títulos enviados para escolas atendidas pelo projeto Encontros de Leitura.','Crianças','Incentivo à leitura. Conscientização a respeito da importância da leitura. Melhoria da qualidade da educação pública','80 páginas','','Capa: papel cartão supremo Páginas: papel couché certificado FSC','R$ 28,40','http://scf.natura.net/Media/thumb/27834.jpg',3),(13,'Conjunto de lápis grafite com borracha','Lápis grafite com borracha, em corpo triangular e mais anatômico. Qualidade Faber-Castell.','Crianças em fase escolar, jovens/adultos em fase escolar/universitária, escritórios, escolas, etc','(1) corpo triangular (mais anatômico), (2) com borracha, (3) madeira com certificação FSC (onde houver selo no cartucho), (3) qualidade Faber-Castell, (4) 7 conjuntos de lápis grafite = 1 beneficiado* por 1 dos projetos do Programa por 1 ano inteiro, em 2011.','Caixa com 6 unidades','','material cerâmico, grafite, madeirareflorestada, guarniçãode alumínioe borrachasintética','R$ 9,80','http://scf.nat